pub enum Error {

    /// Only `svg` and `svgz` suffixes are supported.
    InvalidFileSuffix,

    /// Failed to open the provided file.
    FileOpenFailed,

    /// Only UTF-8 content are supported.
    NotAnUtf8Str,

    /// Compressed SVG must use the GZip algorithm.
    MalformedGZip,

    /// SVG doesn't have a valid size.
    ///
    /// Occurs when width and/or height are <= 0.
    ///
    /// Also occurs if width, height and viewBox are not set.
    /// This is against the SVG spec, but an automatic size detection is not supported yet.
    InvalidSize,

    /// Failed to parse an SVG data.
    ParsingFailed(roxmltree::Error),
}

pub enum FitTo {

    /// Keep original size.
    Original,

    /// Scale to width.
    Width(u32),

    /// Scale to height.
    Height(u32),

    /// Zoom by factor.
    Zoom(f32),
}

pub enum Paint {

    /// Paint with a color.
    Color(Color),

    /// Paint using a paint server.
    Link(String),
}

pub enum ImageKind {

    /// A raw JPEG data. Should be decoded by the caller.
    JPEG(Vec<u8>),

    /// A raw PNG data. Should be decoded by the caller.
    PNG(Vec<u8>),

    /// A preprocessed SVG tree. Can be rendered as is.
    SVG(crate::Tree),
}

pub enum FeCompositeOperator {
    Over,
    In,
    Out,
    Atop,
    Xor,
    Arithmetic {
        k1: f64,
        k2: f64,
        k3: f64,
        k4: f64,
    },
}

pub enum FeImageKind {

    /// An image data.
    Image(ImageKind),

    /// A reference to an SVG object.
    ///
    /// `feImage` can reference any SVG object, just like `use` element.
    Use(String),
}

pub enum TextRendering {
    OptimizeSpeed,
    OptimizeLegibility,
    GeometricPrecision,
}

pub enum FeColorMatrixKind {
    Matrix(Vec<f64>),
    Saturate(NormalizedValue),
    HueRotate(f64),
    LuminanceToAlpha,
}

pub enum TransferFunction {

    /// Keeps a component as is.
    Identity,

    /// Applies a linear interpolation to a component.
    ///
    /// The number list can be empty.
    Table(Vec<f64>),

    /// Applies a step function to a component.
    ///
    /// The number list can be empty.
    Discrete(Vec<f64>),

    /// Applies a linear shift to a component.
    #[allow(missing_docs)]
    Linear {
        slope: f64,
        intercept: f64,
    },

    /// Applies an exponential shift to a component.
    #[allow(missing_docs)]
    Gamma {
        amplitude: f64,
        exponent: f64,
        offset: f64,
    },
}

pub enum FeLightSource {
    FeDistantLight(FeDistantLight),
    FePointLight(FePointLight),
    FeSpotLight(FeSpotLight),
}

pub enum PathSegment {
    MoveTo {
        x: f64,
        y: f64,
    },
    LineTo {
        x: f64,
        y: f64,
    },
    CurveTo {
        x1: f64,
        y1: f64,
        x2: f64,
        y2: f64,
        x: f64,
        y: f64,
    },
    ClosePath,
}
